import Gif from "./Gif"

export default function ListOfGifs({ gifs }) {

    return (
        <div className="grid">
            {
                gifs.map(({ id, title, url }) => (
                    <Gif
                        key={id}
                        title={title}
                        id={id}
                        url={url}
                    />
                ))
            }
        </div>
    )
}
